		public static void SendMail01(int port)
		{
			DoInThread(delegate ()
			{
				System.Net.Mail.MailMessage mail = new System.Net.Mail.MailMessage() { Subject = "Testik", IsBodyHtml = true, Body = "Ahoj světe\r\n" + DateTime.Now.ToString("HH:mm:ss"), BodyEncoding = Encoding.UTF8, SubjectEncoding = Encoding.UTF8 };
				mail.Sender = new System.Net.Mail.MailAddress("sender@test.cz");
				mail.From = new System.Net.Mail.MailAddress("from@test.cz");
				mail.To.Add(new System.Net.Mail.MailAddress("receiver1@test.cz"));
				mail.To.Add(new System.Net.Mail.MailAddress("receiver2@test.cz"));
				mail.CC.Add(new System.Net.Mail.MailAddress("cc1@test.cz"));
				mail.CC.Add(new System.Net.Mail.MailAddress("cc2@test.cz"));
				mail.ReplyToList.Add(new System.Net.Mail.MailAddress("reply.to1@test.cz"));
				mail.ReplyToList.Add(new System.Net.Mail.MailAddress("reply.to2@test.cz"));

				using (System.IO.MemoryStream ms = new System.IO.MemoryStream())
				{
					byte[] buffer = System.Text.Encoding.UTF8.GetBytes("Ahoj Ahoj Ahoj Ahoj Ahoj Ahoj Ahoj\r\nsvěte světe světe světe světe světe");
					ms.Write(buffer, 0, buffer.Length);
					ms.Position = 0;
					mail.Attachments.Add(new System.Net.Mail.Attachment(ms, "att.pdf"));
					mail.Attachments.Add(new System.Net.Mail.Attachment(@"c:\inetpub\wwwroot\Palko\BL\bin\Fortum.BL.Common.Core.pdb"));
					//mail.Attachments.Add(new System.Net.Mail.Attachment(@"c:\Users\pokormar\Desktop\Capture01.PNG"));

					new System.Net.Mail.SmtpClient("127.0.0.1", port) { Timeout = 600000 }.Send(mail);
				};
			});
		}

